import React, { useState } from "react";

const UserManagement = () => {
  const [users, setUsers] = useState([
    { id: "1", name: "Ahmed", email: "ahmed@example.com", tel: "12345678" },
    { id: "2", name: "Sana", email: "sana@example.com", tel: "87654321" },
  ]);

  const [editingUser, setEditingUser] = useState(null);
  const [formData, setFormData] = useState({
    id: "",
    name: "",
    email: "",
    tel: "",
  });

  const handleEditClick = (user) => {
    setEditingUser(user.id);
    setFormData(user);
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleSave = () => {
    const updatedUsers = users.map((user) =>
      user.id === editingUser ? formData : user
    );
    setUsers(updatedUsers);
    setEditingUser(null);
  };

  return (
    <div style={styles.container}>
      <h2 style={styles.title}>Liste des Utilisateurs</h2>
      <table style={styles.table}>
        <thead>
          <tr>
            <th style={styles.th}>ID</th>
            <th style={styles.th}>Nom</th>
            <th style={styles.th}>Email</th>
            <th style={styles.th}>Téléphone</th>
            <th style={styles.th}>Actions</th>
          </tr>
        </thead>
        <tbody>
          {users.map((user) => (
            <tr key={user.id}>
              <td style={styles.td}>{user.id}</td>
              <td style={styles.td}>{user.name}</td>
              <td style={styles.td}>{user.email}</td>
              <td style={styles.td}>{user.tel}</td>
              <td style={styles.td}>
                <button
                  style={styles.button}
                  onClick={() => handleEditClick(user)}
                >
                  Modifier
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      {editingUser && (
        <div style={styles.formContainer}>
          <h3 style={styles.title}>Modifier l'utilisateur</h3>
          <form onSubmit={(e) => e.preventDefault()}>
            <label style={styles.label}>ID:</label>
            <input
              style={styles.input}
              type="text"
              name="id"
              value={formData.id}
              disabled
            />

            <label style={styles.label}>Nom:</label>
            <input
              style={styles.input}
              type="text"
              name="name"
              value={formData.name}
              onChange={handleInputChange}
            />

            <label style={styles.label}>Email:</label>
            <input
              style={styles.input}
              type="email"
              name="email"
              value={formData.email}
              onChange={handleInputChange}
            />

            <label style={styles.label}>Téléphone:</label>
            <input
              style={styles.input}
              type="text"
              name="tel"
              value={formData.tel}
              onChange={handleInputChange}
            />

            <button style={styles.saveButton} onClick={handleSave}>
              Enregistrer
            </button>
          </form>
        </div>
      )}
    </div>
  );
};

// CSS inline injecté dans la même page
const styles = {
  container: {
    padding: "20px",
    fontFamily: "Arial, sans-serif",
    maxWidth: "800px",
    margin: "auto",
  },
  title: {
    textAlign: "center",
    color: "#333",
  },
  table: {
    width: "100%",
    borderCollapse: "collapse",
    marginBottom: "20px",
  },
  th: {
    border: "1px solid #ccc",
    padding: "8px",
    backgroundColor: "#f2f2f2",
  },
  td: {
    border: "1px solid #ccc",
    padding: "8px",
    textAlign: "center",
  },
  button: {
    padding: "5px 10px",
    backgroundColor: "#007bff",
    color: "white",
    border: "none",
    borderRadius: "5px",
    cursor: "pointer",
  },
  formContainer: {
    backgroundColor: "#f9f9f9",
    padding: "20px",
    border: "1px solid #ccc",
    borderRadius: "10px",
  },
  label: {
    display: "block",
    marginTop: "10px",
    marginBottom: "5px",
    fontWeight: "bold",
  },
  input: {
    width: "100%",
    padding: "8px",
    marginBottom: "10px",
    borderRadius: "5px",
    border: "1px solid #ccc",
  },
  saveButton: {
    padding: "10px 20px",
    backgroundColor: "#28a745",
    color: "white",
    border: "none",
    borderRadius: "5px",
    cursor: "pointer",
  },
};

export default UserManagement;
